  accommodation: { label: 'Accommodation', color: 'bg-blue-200' },
  activity: { label: 'Activity', color: 'bg-green-200' },
  food: { label: 'Food', color: 'bg-yellow-200' },
  transport: { label: 'Transport', color: 'bg-indigo-200' },
  sightseeing: { label: 'Sightseeing', color: 'bg-pink-200' },
};

export default categoryColors;
